import React, {Component} from 'react';

class App extends Component {
	state = {
	selectedFile: null
	};

	onFileChange = (event) => {
		this.setState({selectedFile: event.target.files[0]});
	};

    render() {
      return (
        <div className="body">
            <h1> GRAPHMONKEY </h1>
			<input type="file" onChange={this.onFileChange}  />
			<label for="file">
				UPLOAD PNG
			</label>
        </div>
     )
   }
 }

export default App
